INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (71, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'I am nearing the end of my Prime Secure Lite coverage period, how do I extend my coverage period?', N'<p>If you are interested in another year of protection, we encourage you to re-apply for Prime Secure Lite via The InLife Store (<a href="www.inlifestore.com.ph" target="_blank">www.inlifestore.com.ph</a>).</p><p>Alternatively, if you feel the need for longer protection, you may contact us at these numbers to assist you with your needs:</p><p>(632) 8-876-1-800 or Toll-Free 1-800-10-INSULAR (4678527)</p>', 7)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (72, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'What is Extended Spouse Coverage?', N'<p>This feature pays an additional lumpsum equal to the sum insured to the beneficiary in the event that both the insured and his/her legal spouse passes away due to the same accident. The time of passing of both spouses may not be more than 180 days from the date of the accident in order to claim the additional sum insured.&nbsp; &nbsp;<br></p>', 4)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (73, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'How does the Cancer, Heart Attack and Stroke (CHAS) Benefit work?', N'<p>According to the Philippine Statistics Office as of 2018, Cancer, Heart Attack and Stroke are the top 3 causes of mortality for Filipinos. Prime Secure Lite is a way to provide financial security to your loves ones in case any of these three medical conditions happen to you.&nbsp;</p><p>You may claim the CHAS benefit detailed in your policy data page after thirty (30) days of receiving your diagnosis.&nbsp;</p><p>You may get full details by downloading the policy provisions and exceptions document.</p>', 5)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (74, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'Can I buy for another person?', N'<p>Applicant-owner and insured should be one and the same person. ID presented should also be from same person.<br></p>', 8)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (75, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 1, N'How do I pay for the policy?', N'<p>You may pay using your Visa or Mastercard credit card or debit card.</p>', 9)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (76, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'Can I pay using someone else’s credit card or debit card?', N'<p>We allow the authorized use of credit cards of the following immediate family members: spouse, children, parents, brothers and sisters of the policyholder.</p><p>For applications to renew the coverage period of Prime Secure Lite, you will need to input your payment details again.</p>', 10)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (77, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'How do I receive my policy?', N'<p>You will receive your policy thru your Customer Portal access which will be provided after a successful purchase of Prime Secure Lite. This is InLife’s on-line policy servicing facility, where you can access your policy information and enjoy online end-to- end policy servicing.</p><p>You will receive the policy documents inside your Customer Portal account within 24-48 hours after purchase.</p><p>You may also refer to our <a href="https://www.insularlife.com.ph/customer-charter" target="_blank">Customer Charter</a> for details.</p>', 11)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (78, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 1, N'How do I make a claim?', N'<p>For claims procedures, please go to Policy Servicing Requirements in <a href="www.insularlife.com.ph" target="_blank">www.insularlife.com.ph</a> for more details. Or contact the following:&nbsp;</p><p>(632) 8-876-1-800 or Toll-Free 1-800-10-INSULAR (4678527)</p><p>You may also refer to our <a href="https://www.insularlife.com.ph/customer-charter" target="_blank">Customer Charter</a> for details.</p>', 12)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (79, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'How do I change my contact and/or beneficiary details after the policy issuance?', N'<p>You may change your contact details or policy details by contacting the following:&nbsp;</p><p>(632) 8-876-1-800 or Toll-Free 1-800-10-INSULAR (4678527)</p><p>You may also refer to our Customer Charter for details.</p>', 13)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (80, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'How can I cancel my policy anytime with full refund of premium?', N'<p>Under the Cooling Off or Free Look Period, you are given 15 days from the time the policy contract was sent to you to review and cancel your policy. If you decide to cancel your policy, you may contact the following:&nbsp;</p><p>(632) 8-876-1-800 or Toll-Free 1-800-10-INSULAR (4678527)</p>', 14)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (81, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'If I have other questions, whom shall I contact?', N'<p>You may refer to our FAQs (Frequently Asked Questions) However, in case there are concerns that are not readily answered or covered by the FAQs, you may contact us at:</p><p>(632) 8-876-1-800 or Toll-Free 1-800-10-INSULAR (4678527)</p><p>You may also refer to our Customer Charter for details.</p>', 15)
GO
INSERT [Content].[Faqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [SortNum]) VALUES (82, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'How does the Covid-19 death benefit work?', N'<p>Aside from the benefits to be paid in case the insured passes away, there is additional cash benefits to be given to the beneficiary in case the cause of death of the insured is Covid-19.&nbsp;<br></p>', 6)
GO
