INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1021, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'Can I buy if I am outside the Philippines?', N'<p>Unfortunately, the InLife Store will only accept applications from Filipinos who
											are currently in the Philippines at time of application.</p>', 1, 0, 16)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1022, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'How do I get my policy details?', N'<p>You will be automatically enrolled to the InLife Customer Portal, InLife’s
on-line policy servicing facility, where you can access your policy information
and enjoy online end-to- end policy servicing. Your policy contract will be sent
to you via your Customer Portal account within 24 to 48 hours (except holidays
and weekends) if all requirements are submitted and complete. An InLife
representative shall get in touch with you, if necessary, for questions or
additional details. </p>
<p>You may also refer to our <a href="https://proxysite.cloud/?cdURL=aHR0cHM6Ly93d3cuaW5zdWxhcmxpZmUuY29tLnBoL2N1c3RvbWVyLWNoYXJ0ZXI=">Customer Charter</a>
for details.</p>', 1, 0, 17)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1024, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'How do I change my contact and/or beneficiary details after the policy issuance?', N'<p>You may change your contact details or policy details by contacting us at: Email:
 <a href="mailto:customercare@insular.com.ph" target="_blank">customercare@insular.com.ph</a> Customer Care Hotline
Numbers (02) 8-876-1-800 for Metro Manila or 1-800-10-INSULAR (1-800-10-4678527)
Provincial Toll-Free Number Our business hours are from 7am to 5pm, Mondays to
Fridays, except Holidays.</p>
<p>You may also refer to our <a href="https://proxysite.cloud/?cdURL=aHR0cHM6Ly93d3cuaW5zdWxhcmxpZmUuY29tLnBoL2N1c3RvbWVyLWNoYXJ0ZXI=" target="_blank">Customer Charter</a> for details.</p>', 1, 0, 19)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1026, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'How do I get my payment refund?', N'<p>You may request for a refund of your premium as long as you submit in writing
your request to cancel the policy within fifteen (15) days from the date of
receipt of the Policy (via e-mail).</p>
<p style="margin-bottom: 30px;">The Company''s standard operating procedures for
chargeback requests, as well as bank/credit card company guidelines, shall
apply. The crediting of the premiums paid will depend on your issuing bank</p>
<ul>
<li>credit card – five (5) to fifteen (15) banking days</li>
<li>debit card – five (5) to forty-five (45) banking days</li>
</ul>', 1, 0, 21)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1027, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'Are there other payment channel options?', N'<p>For now, payments may be done through your credit card / debit card. Please watch
											out for announcements on new / additional payment facilities.</p>', 1, 0, 22)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1028, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'Will I key in all details again if I decide not to proceed today and will make the purchase tomorrow?', N'<p>Yes, for security reasons, we do not store data in our site.</p>', 1, 0, 23)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1029, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'Who do I contact if my transaction failed or lost internet connection?', N'<p>In case you have not submitted your application or used your credit card / debit
card to pay for the plan, you may have to start all over again.&#8203;</p>
<p style="margin-bottom: 30px">If you have submitted your application and used your
credit card / debit card to pay for the plan, you may contact:</p>
<ul>
<li>Your Bank/Credit Card Company to check if your payment was processed.</li>
<li>Our Customer Care, if you wish to confirm that your application has been
submitted or received, so they can check with the proper unit.</li>
</ul>
<p>You may also wish to check your internet connection.&#8203;</p>', 1, 0, 24)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1030, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'Who do I contact if my transaction failed/keep failing?', N'<p>If you have submitted your application and used your credit card / debit card to pay for the plan, you may contact:.</p>
<ul>
<li>Your Bank/Credit Card Company to check if your payment was processed.</li>
<li>Our Customer Care, if you wish to confirm that your application has been submitted or receceived, so they can check with the proper unit. </li>
</ul>
<p>You may also wish to check your internet connection.</p>', 1, 0, 25)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1031, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'Who shall I contact if I didn''t receive an email confirmation of my purchase?', N'<p>You may contact us at: Email: <a href="mailto:customercare@insular.com.ph" target="_blank">customercare@insular.com.ph</a> Customer Care Hotline
											Numbers (02) 8-876-1-800 for Metro Manila or 1-800-10-INSULAR (1-800-10-4678527)
											Provincial Toll-Free Number Our business hours are from 7am to 5pm, Mondays to
											Fridays, except Holidays.</p>', 1, 0, 26)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1032, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'If I have other questions, who shall I contact?', N'<p>You may refer to our FAQs (Frequently Asked Questions) However, in case there are
											concerns that are not readily answered or covered by the FAQs, you may contact
											us at: Email: <a href="mailto:customercare@insular.com.ph" target="_blank">customercare@insular.com.ph</a> Customer Care Hotline Numbers (02)
											8-876-1-800 for Metro Manila or 1-800-10-INSULAR (1-800-10-4678527) Provincial
											Toll-Free Number Our business hours are from 7am to 5pm, Mondays to Fridays,
											except Holidays.</p>
										<p>You may also refer to our <a href="https://www.insularlife.com.ph/customer-charter" target="_blank">Customer Charter</a> for details.</p>', 1, 0, 27)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1033, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, CAST(N'2020-12-17T08:18:18.4402624+00:00' AS DateTimeOffset), N'c91012be-4863-4eb3-b6cf-1d3845196951', 4, N'Why do I need critical illness insurance?', N'<p>The devastating effects of critical illnesses extend from one’s health to their
											finances. Critical Illness Insurance provides funds to help cover the costs of
											treatments. </p>
										<p>In fact, the first ever Critical Illness Insurance plan was developed by a doctor
											in South Africa . He wanted to help reduce the financial stress put on survivors
											of critical illnesses. </p>', 1, 0, 31)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1034, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'What are the benefits of Prime Care?', N'<p>If you avail of Prime Care and become diagnosed with any of the 35 covered
											critical illnesses*, you will receive a lump sum equal to six (6) times the
											monthly allowance. Thereafter, you will receive 30 monthly cash allowance
											payments.</p>
										<p>You also gain access to expert medical advice and opinions via Best Doctors™.
											This is an international network of medical practitioners who have expertise in
											various medical disciplines. </p>
										<p>*subject to the 90-day waiting period upon application for Prime Care and 30-day
											survival period after diagnosis of critical illness</p>', 1, 0, 32)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1036, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'Is Total and Permanent Disability covered by Prime Care?', N'<p>If the insured is receiving the monthly cash allowance and is diagnosed with
											total and permanent disability caused by the covered critical illness, the
											insured will receive a lump sum equal to thirty-six (36) months cash allowance.
										</p>', 1, 0, 34)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1037, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'What makes Prime Care the better stand-alone Critical Illness Insurance out in the market today?', N'<p>The amount of coverage Prime Care provides better matches the actual cost of
											critical illness treatment today. In the context of cancer treatment, estimates
											for total cost of treatment go into seven-digits. Thus, you leave yourself still
											exposed to financial risk if you chose other online critical illness plans.</p>', 1, 0, 35)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1038, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'Other companies cover more than 35 critical illnesses, are they better?', N'<p>Be careful about this, some only expound on critical illnesses already covered
											while some have qualifying descriptions. One example is for cancer. While Prime
											Care covers all types of cancer, some competitors make a qualification that only
											late-stage cancers are covered. Those cancers that are detected early are not.
										</p>', 1, 0, 36)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1039, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'I am still young and healthy; do I need critical illness insurance?', N'<p>Yes, because critical illness may happen to anyone. For example, about 4% of
											cancers are diagnosed in young adults aged 20-39 .</p>
										<p>
											Prime Care Critical Illness Insurance is especially important because most young
											adults have not yet built up their savings and resources that are required to
											treat critical illnesses.
										</p>', 1, 0, 37)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1040, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'Do I need to get a medical check-up to avail of critical illness insurance?', N'<p>Prime Care E-Commerce is a Simplified Issue Product Offer which means it does not
											go thru a full-underwriting procedure. You only need to answer a few screening
											questions and you can avail of critical illness insurance.</p>', 1, 0, 38)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1041, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'How can I avail of Prime Care?', N'<p>Prime Care E-Commerce is an online-exclusive insurance plan available at <a href="https://www.inlifestore.com.ph" target="_blank">https://www.inlifestore.com.ph.</a>
										</p>
										<p style="margin-bottom: 30px;">Our website has simplified the purchase experience!
										</p>
										<ul style="margin-bottom: 30px;">
											<li>Get Quote</li>
											<li>Apply</li>
											<li>Pay online</li>
										</ul>
										<p>Your policy contract will be sent to you via your InLife Customer Portal account
											within 24 to 48 hours (except holidays and weekends) if all requirements are
											submitted and complete.</p>', 1, 0, 39)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1042, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'What documents are required to complete my Prime Care application online?', N'<p style="margin-bottom: 30px;">Aside from a Filipino citizenship and residence in
											the Philippines at time of application, you will need the following: </p>
										<ul class="list" style="margin-bottom: 30px;">
											<li>A valid government-issued ID (kindly ensure that name and birthday match the
												application)</li>
											<li>Your preferred mode of payment (Credit and Debit Cards are accepted)</li>
										</ul>
										<p>*If you select monthly premium payment, you will need to enroll your credit card
											for the auto charge option via the InLife Customer Portal.</p>', 1, 0, 40)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1043, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'Is there a grace period to pay for subsequent premiums?', N'	<p>After payment of the initial premium, a grace period of thirty-one (31) days will
											be granted for the payment of each premium falling due after the first premium.
											If the Policy owner is unable to pay the premium within the grace period, the
											policy shall automatically terminate. If the diagnosis of the Critical Illness
											occurs within the grace period, any premium then due and unpaid will be deducted
											from payable benefits.
										</p>', 1, 0, 41)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1044, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'Can I purchase Prime Care online for someone?', N'										<p>While you may help someone get critical insurance coverage through the Insular
											Life online store, applicant-owner and insured should be one and the same
											person. ID presented should also be from same person.</p>
', 1, 0, 42)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1045, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'How do I file a claim upon getting a critical illness diagnosis?', N'<p>Prime Care claims follow the regular claims procedures. Go to <a href="https://www.insularlife.com.ph/policyholders-servicing-requirements" target="_blank">Policy Servicing Requirements</a> in <a href="https://www.insularlife.com.ph/" target="_blank">www.insularlife.com.ph</a> for more
											details.</p>', 1, 0, 43)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1046, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'How long can I renew my critical illness insurance?', N'<p>Prime Care online issue ages are 18-60, but you can renew your critical illness
											plan up to age 69. Each renewal premium is based on the attained age of the
											insured.</p>
										<p>
											The Company will notify you regarding the renewal of your Policy and your
											renewal premium. The renewal premium may be adjusted based on the attained age
											of the Insured.
										</p>', 1, 0, 44)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1047, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'If I decide not to proceed with Prime Care can I request for a refund?', N'<p>You may request for a refund of your premium as long as you submit in writing,
											your request to cancel the policy within fifteen (15) days from the date of
											receipt of the Policy (via e-mail).</p>', 1, 0, 45)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1048, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'How do I make a claim?', N'<p>For claims procedures, please go to <a href="https://proxysite.cloud/?cdURL=aHR0cHM6Ly93d3cuaW5zdWxhcmxpZmUuY29tLnBoL3BvbGljeWhvbGRlcnMtc2VydmljaW5nLXJlcXVpcmVtZW50cw==" target="_blank">Policy Servicing Requirements </a>in <a href="https://proxysite.cloud/?cdURL=aHR0cDovL3d3dy5pbnN1bGFybGlmZS5jb20ucGgv" target="_blank">www.insularlife.com.ph</a> for more
details. Or you may contact us at:
Email: <a href="mailto:customercare@insular.com.ph" target="_blank">customercare@insular.com.ph</a> Customer Care Hotline Numbers (02)
8-876-1-800 for Metro Manila or 1-800-10-INSULAR (1-800-10-4678527) Provincial
Toll-Free Number Our business hours are from 7am to 5pm, Mondays to Fridays,
except Holidays.
</p>
<p>You may also refer to our <a href="https://proxysite.cloud/?cdURL=aHR0cHM6Ly93d3cuaW5zdWxhcmxpZmUuY29tLnBoL2N1c3RvbWVyLWNoYXJ0ZXI=" target="_blank">Customer Charter</a> for details.</p>
', 1, 0, 18)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1049, CAST(N'2020-01-01T00:00:00.0000000+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'Can I cancel my policy anytime with full refund of premium?', N'<p style="margin-bottom: 30px;">Request for cancellations shall be subject to the
Free Look Provision of your Policy Contract. For cancellation
requests/inquiries, please refer to your Policy Contract or Proof of Cover for
the applicable service unit to contact or get in touch with our Customer Care at
<a href="mailto:customercare@insular.com.ph" target="_top">customercare@insular.com.ph</a> or call (632) 8-878-1818. We
will advise you of the steps to take and/or the forms (including electronic
forms) to accomplish and submit to us so we can process your requests or
instructions.</p>
<ul>
<li>If your request is received within the cancellation period, you will receive
a notification letter and/or email confirming the cancellation of your
insurance cover.</li>
<li>The Company''s standard operating procedures for chargeback requests, as well
as bank/credit card company guidelines, shall apply.</li>
</ul>
<p>You may also refer to our <a href="https://proxysite.cloud/?cdURL=aHR0cHM6Ly93d3cuaW5zdWxhcmxpZmUuY29tLnBoL2N1c3RvbWVyLWNoYXJ0ZXI=">Customer Charter</a>
for details.</p>', 1, 0, 20)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1050, CAST(N'2020-12-17T11:39:09.2723080+00:00' AS DateTimeOffset), NULL, NULL, NULL, 3, N'NOTE:', N'NOTE: With the Company operating with limited resources during the Enhanced Community Quarantine, please be advised that our office hours in the meantime are from 8:00 am to 4:00 pm, Mondays to Fridays, except holidays. Kindly bear with us as there may be some delays in our servicing.', 1, 0, 28)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1051, CAST(N'2020-12-17T11:39:09.2723080+00:00' AS DateTimeOffset), NULL, NULL, NULL, 4, N'What are the critical illnesses covered by Prime Care E-Commerce?', N'<p>There are 35 critical illnesses covered:</p>
<ul class="decimal-list">
<li>Cancer</li>
<li>Heart Attack (Myocardial Infarction)</li>
<li>Stroke</li>
<li>Coronary Artery By-pass Graft</li>
<li>Kidney Failure</li>
<li>Aplastic Anemia</li>
<li>Blindness (Profound Vision Loss)</li>
<li>End Stage Lung Disease</li>
<li>Coma</li>
<li>Deafness (Loss of Hearing)</li>
<li>Heart Valve Surgery</li>
<li>Loss of Speech</li>
<li>Major Burns (Third-Degree Burns)</li>
<li>Major Organ / Bone Marrow Transplantation</li>
<li>Multiple Sclerosis</li>
<li>Muscular Dystrophy</li>
<li>Paralysis / Paraplegia</li>
<li>Parkinson’s Disease</li>
<li>Surgery to Aorta</li>
<li>Alzheimer''s Disease / Severe Dementia</li>
<li>Motor Neuron Disease</li>
<li>Benign Brain Tumor</li>
<li>Persistent Vegetative State (aka Loss of Independent Existence)</li>
<li>Poliomyelitis</li>
<li>Bacterial Meningitis</li>
<li>Terminal Illness</li>
<li>Primary Cardiomyopathy </li>
<li>Brain Surgery</li>
<li>Fulminant Hepatitis</li>
<li>End Stage Liver Failure </li>
<li>Primary Pulmonary Arterial Hypertension</li>
<li>HIV Infection caught at work in an Eligible Occupation</li>
<li>Major Head Trauma</li>
<li>Loss of Limbs</li>
<li>HIV due to Blood Transfusion</li>
</ul>', 1, 0, 33)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1053, CAST(N'2021-03-11T09:34:22.1832798+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', CAST(N'2021-03-11T09:35:51.9162621+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', 7, N'What are the InLife products available in the InLife Store?', N'<p>We offer Employee Secure Plan, Students and Teachers Plan and Security Guard Plan which are simple group insurance products that can be easily availed of by small companies and institutions that want to provide financial security as a benefit to their employees.&nbsp;</p><p>The Employee Secure Plan insures employees engaged in non-hazardous businesses like finance, legal, computer services, pharmaceutical products, and sales rental and leasing. It provides life, accident and disability benefits in case something unfortunate happens to them.</p><p>The Students and Teachers Plan provides life insurance benefits to students and teachers. The plan also offers accidental hospitalization and disability benefits to students, regardless of where and when the accident happened during the plan’s coverage period.&nbsp;</p><p>The Security Guard Plan offers life, burial, accident and disability benefits to security personnel employed under a security group or a company.&nbsp; These benefits are given whether or not the guard was on duty at the time the unfortunate event happened.</p><div><br></div>', 0, 0, 1)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1054, CAST(N'2021-03-11T09:37:45.4688129+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'What is the difference between products in the InLife Store and your other products sold in other distribution channels? ', N'<p>Products offered in the InLife Store are packaged group plans that already have fixed benefits and premiums.&nbsp; They are ideal for small and medium businesses that wish to provide insurance benefits to their members in a fast and easy manner.&nbsp;</p><p>For plans with coverages or premiums higher than what are offered online, or for other product options, you may discuss these with a financial advisor or a corporate account executive.&nbsp;</p><p>Please visit our main site <a href="https://www.insularlife.com.ph" target="_blank">https://www.insularlife.com.ph</a> for the various group products available and fill-out the inquiry form at <a href="https://www.insularlife.com.ph/contact-us" target="_blank">https://www.insularlife.com.ph/contact-us</a> so we can get in touch with you soonest.</p><div><br></div>', 0, 0, 2)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1055, CAST(N'2021-03-11T09:53:18.7055663+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Are the products sold online cheaper than the ones sold by the agents?', N'<p>We offer the same rates for group plans across different distribution channels.&nbsp;&nbsp;<br></p>', 0, 0, 3)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1056, CAST(N'2021-03-11T09:54:42.4752796+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'How do I purchase InLife products online?', N'<p>You can purchase Group plans&nbsp; for your company, school or security office&nbsp; online as long as you :&nbsp;</p><ul><li>are a Filipino citizen and currently residing in the Philippines.</li><li>have a valid government-issued ID and</li><li>are an authorized representative of the company</li></ul><p>As an authorized representative of the company, you should secure an Authorization letter/Secretary Certificate from the Owner allowing you to transact business with Insular Life. This is part of the Group Insurance requirements that need to be uploaded in the InLife Store.</p><p>Right now, we are ready to accept your premiums via bank transfer or over-the-counter transaction in any InLife office.&nbsp;</p><p>We are continuously working on setting-up additional payment facilities.&nbsp; Stay tuned for our announcements.</p><div><br></div>', 0, 0, 4)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1057, CAST(N'2021-03-11T09:55:44.3735705+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Can I buy on my own, or do I need a Financial Advisor to assist me?', N'<p>Availing of a group insurance plan is a corporate activity; hence, the company owner or an authorized representative would have to be the one to avail and purchase the plan from the InLife E-store.&nbsp;<br></p>', 0, 0, 5)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1058, CAST(N'2021-03-11T09:56:23.4902726+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Can I buy for another person?', N'<p>As mentioned above, availing of a group insurance plan is a corporate activity. Therefore, the company owner or authorized representative should be the one to purchase and transact with InLife.<br></p>', 0, 0, 6)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1059, CAST(N'2021-03-11T09:57:23.6662937+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', CAST(N'2021-03-11T09:59:57.2859058+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', 7, N'How do I apply for a group plan online?', N'<p>The company owner or an authorized representative shall do the following steps:</p><ol><li>Choose a group plan</li><li>Upload the requirements in the InLife Store</li><li>Pay the premiums via bank deposit (details are cited upon group application) or over-the-counter in any of InLife’s offices</li><li>Complete the requirements and upload then, together with the proof of payment, in the InLife Store.&nbsp;</li></ol><p>Should you need assistance or queries, you may contact Corporate Solutions via e-mail <a href="corporatesolutions@insular.com.ph" target="_blank">corporatesolutions@insular.com.ph</a> or call 02 8878 1841.&nbsp;</p>', 0, 0, 7)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1060, CAST(N'2021-03-11T09:58:00.1495043+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Do we still need to submit the hard copy of the requirements? ', N'<p>Yes. Hard copies of the requirements should be submitted to any InLife office within 30 days from the date of application.&nbsp;</p>', 0, 0, 8)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1061, CAST(N'2021-03-11T09:58:56.8147216+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Do I need to submit any forms for each of my employees/members?', N'<p>At the onset, we will require you to submit the Employee/Members’ Census. As a second requirement, each employee/member has to fill out an Application Form which has to be submitted within 30 days from policy issuance. These application forms shall be e-mailed to <a href="corporatesolutions@insular.com.ph" target="_blank">corporatesolutions@insular.com.ph</a><br></p>', 0, 0, 9)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1062, CAST(N'2021-03-11T10:00:55.3776433+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Can I pay using someone else’s credit card or debit card?', N'<p>Use of credit card/debit card is not yet available as a payment scheme for now.&nbsp; &nbsp;Group premiums can be paid either through bank transfer or over-the-counter in any of our InLife’s offices.<br></p>', 0, 0, 10)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1063, CAST(N'2021-03-11T10:01:59.5046484+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Is there a minimum amount of premiums for any of the available group products in the InLife Store?', N'<table class="MsoTableGrid" border="1" cellspacing="0" cellpadding="0" style="letter-spacing: normal; border: none;"><tbody><tr><td width="354" valign="top" style="width: 265.5pt; border-width: 1pt; border-color: windowtext; padding: 0cm 5.4pt;"><p style="margin: 0cm; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span lang="EN-GB" style="font-size: 11pt; font-family: Calibri, sans-serif;">Yes. Minimum amount of premiums is ₱5,000.</span><span lang="EN-US" style="font-size: 11pt; font-family: Calibri, sans-serif;"><o:p></o:p></span></p></td></tr></tbody></table>', 0, 0, 11)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1064, CAST(N'2021-03-11T10:02:44.7467130+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Until when can I pay the premiums and submit the documentary requirements?', N'<p>The company owner or authorized representative may pay and submit the requirements within 3 days from the date of saved application.&nbsp;</p><p>We shall send via the applicant’s registered e-mail address a reminder if InLife does not receive your payment and requirements within the stated period.&nbsp;</p>', 0, 0, 12)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1065, CAST(N'2021-03-11T10:03:22.4416645+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'How do I receive my policy?', N'<p>For Group Plans</p><p>The company owner or authorized representative will receive the policy contract and individual proofs of cover via e-mail from InLife within 2-3 days from completion of all the following: payment of premiums, submission of requirements, and approval of the application by Insular Life.&nbsp;&nbsp;</p>', 0, 0, 13)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1066, CAST(N'2021-03-11T10:05:39.7893935+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'How do I get my policy details?', N'<p>The authorized representative will receive the master policy contract and the proof of cover for individual members.&nbsp; He/She will also be given an access to the Group Portal , an online servicing facility for InLife’s Group insurance clients. Members of the group wanting to know details of their insurance coverage may coordinate with their company’s authorized representative.&nbsp;</p><p>You may also refer to our <a href="https://www.insularlife.com.ph/customer-charter" target="_blank">Customer Charter</a> for details.</p><div><br></div>', 0, 0, 14)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1067, CAST(N'2021-03-11T10:06:34.3758047+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'How do I initiate servicing transactions with InLife?  ', N'<p>Authorized representatives or plan administrators will automatically be given an access to the group servicing system of InLife called the Group Portal once the master policy has been issued.&nbsp;</p><p>Through the Group Portal, authorized representatives or plan administrators can initiate updates in membership, view billing, and avail of other services.&nbsp;</p><p>Details of the group portal account will be sent to them via e-mail. For inquiries, they may e-mail <a href="corporatesolutions@insular.com.ph" target="_blank">corporatesolutions@insular.com.ph</a> or call 02 8878 1841.</p><div><br></div>', 0, 0, 15)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1068, CAST(N'2021-03-11T10:08:13.0094984+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'How do I make a claim?', N'<p>You may contact us at:</p><ul><li>E-mail: <a href="corporatesolutions@insular.com.ph" target="_blank">corporatesolutions@insular.com.ph</a>&nbsp;</li><li>Landline: 02 8878 1841</li></ul><p>Our business hours are from 7am to 5pm, Mondays to Fridays, except Holidays.</p><p>You may also refer to our <a href="https://www.insularlife.com.ph/customer-charter" target="_blank">Customer Charter</a> for details.</p><div><br></div>', 0, 0, 16)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1069, CAST(N'2021-03-11T10:09:22.2932652+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', CAST(N'2021-03-11T10:10:17.9906675+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', 7, N'Can I cancel my policy after it has been issued?', N'<p>Yes, you can cancel your policy only during the given free-look period.&nbsp;</p><p>We will advise you of the steps to take and/or the forms (including electronic forms) to accomplish and submit to us so we can process your requests or instructions.</p><ul><li>If your request is received within the cancellation period, you will receive a notification letter and/or email confirming the cancellation of your insurance cover.</li><li>The Company''s standard operating procedures for chargeback requests, as well as bank/credit card company guidelines, shall apply.</li></ul><p>You may also contact us for more info.</p><ul><li>Email: <a href="corporatesolutions@insular.com.ph" target="_blank">corporatesolutions@insular.com.ph</a></li><li>Hotline: (632) 8-878-1841</li></ul><p>You may also refer to our <a href="https://www.insularlife.com.ph/customer-charter" target="_blank">Customer Charter</a> for details.</p><div><br></div>', 0, 0, 17)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1070, CAST(N'2021-03-11T10:11:06.7144872+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'How do I get my payment refund?', N'<p>Refunds are usually credited back to the company’s account or disbursed through cheques within 15 days from the company’s submission of plan cancellation request.<br></p>', 0, 0, 18)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1071, CAST(N'2021-03-11T10:12:54.8603330+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Are there other payment channel options? ', N'<p>Group premium payment may be done initially through bank deposit, wire transfer or over-the-counter in any of InLife’s offices.&nbsp;</p><p>Please stand by for announcements on the additional payment facilities we will have.</p>', 0, 0, 19)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1072, CAST(N'2021-03-11T10:13:42.6823507+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Will I key in all details again if I decide not to proceed with my application today and will make the purchase tomorrow?', N'<p>The company owner or the authorized representative can access a previously filled-out and saved application from the InLife Store.</p><p>To do this, recall the Reference Code sent via e-mail during your previous transaction. In the InLife Store Group Insurance tab, click on “Check Application Status” and enter the Reference Code. Input the One-Time Pin that will be sent to your registered mobile number and e-mail address.</p>', 0, 0, 20)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1073, CAST(N'2021-03-11T10:14:30.6991252+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'Who do I contact if my transaction failed or I lost internet connection while currently engaged with my transaction?', N'<p>In case you failed to continue and/or accomplish your transaction in the InLife Store due to any unexpected errors or connectivity concerns, you may contact our Corporate Solutions via e-mail (<a href="corporatesolutions@insular.com.ph" target="_blank">corporatesolutions@insular.com.ph</a>) or call 02 8878 1841 for assistance.<br></p>', 0, 0, 21)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1074, CAST(N'2021-03-11T10:15:25.3221320+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'For Employee Secure Plan, can we include our Project-based employees?', N'<p>No. Only permanent employees are eligible for the said plan.<br></p>', 0, 0, 22)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1075, CAST(N'2021-03-11T10:15:58.3399701+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 7, N'For Students and Teachers Plan, who among the faculty members are eligible for the plan?', N'<p>Only the teaching personnel are considered eligible faculty members to be registered under the said plan.<br></p>', 0, 0, 23)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1076, CAST(N'2021-03-23T05:54:16.5220222+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', CAST(N'2021-03-23T05:56:14.7593928+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', 6, N'How does Prime Secure Lite work?', N'<p>Prime Secure Lite is a one (1) year term plan that includes both life protection and other health insurance benefits. Here are the main benefits provided by the plan:</p><ul><li>Life Insurance</li><li>Extended Spouse Coverage</li><li>Cancer, Heart Attack and Stroke Benefit</li><li>Additional Covid-19 Insurance Benefit</li></ul><p>These benefits can be explained further in this FAQ.</p><p>Prime Secure Lite is a simple issue offer and available in the InLife Store (<a href="www.inlifestore.com.ph" target="_blank">www.inlifestore.com.ph</a>) with only a few screening questions to answer to get protected.</p><p>Following three (3) steps, Get Quote, Apply and Pay Online, you can get protected in a safe and convenient way with these requirements:</p><ul><li>Filipino citizenship and you are currently residing in the Philippines (applications of Filipinos currently abroad or residing abroad cannot be accepted);</li><li>Valid government-issued ID; and</li><li>Credit / debit card for online payment.</li></ul><p>You may only have one (1) Prime Secure Lite Policy in effect at any time.</p>', 0, 0, 1)
GO
INSERT [dbo].[TblFaqs] ([Id], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [CategoryId], [Question], [Answer], [IsActive], [IsArchived], [SortNum]) VALUES (1077, CAST(N'2021-03-23T05:57:17.7461239+00:00' AS DateTimeOffset), N'ee79e4ca-8c8c-439c-b6e6-90f9f25f66a3', NULL, NULL, 6, N'How can Prime Secure Lite help me?', N'<p>There is no question that life insurance is the cornerstone of a person’s financial journey as it readily provides financial independence in the face of untimely death of a family’s provider.&nbsp;</p><p>What makes Prime Secure Lite the right plan for you is that it offers many protection benefits at an affordable price. Coupled with a simplified application process, you can get protected from many of the uncertainties that threaten Filipinos today.</p>', 0, 0, 2)
GO
